import {curry, compose, map, fill, zip, range, identity, flatten} from 'lodash';
import {List, Set} from 'immutable';


/**
 * Value on a board representing a black stone.
 */
export const BLACK = 'black';


/**
 * Value on a board representing a white stone.
 */
export const WHITE = 'white';


/**
 * @private
 */
export const EMPTY = null;


/**
 * @private
 */
export const SIZE_KEY = 'size';


/**
 * @private
 */
export function allPossibleMoves(size) {
    return Set(flatten(map(
        range(size),
        i => map(
            zip(range(size), fill(Array(size), i)),
            List
        )
    )));
}


/**
 * Returns unoccupied positions on the board.
 *
 * @private
 * @param {Map} board
 * @returns {Set}
 */
export function emptyPositions(board) {
    return allPossibleMoves(board.get(SIZE_KEY)).subtract(board.keys());
}


/**
 * Gets the spaces immediately touching the passed position.
 *
 * Considers the board size and acts correctly on sides and corners.
 *
 * @private
 * @param {Map} board
 * @param {List} position
 * @returns {Set}
 */
export function adjacentPositions(board, position) {
    const inc = i => i + 1;
    const dec = i => i - 1;
    const size = board.get(SIZE_KEY);
    const [x, y] = [position.first(), position.last()];
    const check = compose(
        curry(Math.min, 2)(size - 1),
        curry(Math.max, 2)(0)
    );

    return Set([
        [identity, inc],
        [identity, dec],
        [inc, identity],
        [dec, identity],
    ].map(
        ([first, last]) => List.of(check(first(x)), check(last(y)))
    )).subtract(Set.of(position));
}


/**
 * Similar to {@link adjacentPositions}, but filters on a state.
 *
 * @private
 * @param {Map} board
 * @param {List} position
 * @param {string} color
 * @returns {Set}
 */
export function matchingAdjacentPositions(board, position, color) {
    if (color === undefined) {
        color = board.get(position, EMPTY);
    }

    return adjacentPositions(board, position)
        .filter(pos => board.get(pos, EMPTY) === color);
}


/**
 * Gets a set of positions of the logical group associated with the given position.
 *
 * @private
 * @param {Map} board
 * @param {List} position
 * @returns {Set}
 */
export function group(board, position) {
    let found = Set();
    let queue = Set.of(position);

    while (!queue.isEmpty()) {
        const current = queue.first();
        const more_matching = matchingAdjacentPositions(board, current);

        found = found.add(current);
        queue = queue.rest().union(more_matching.subtract(found));
    }

    return found;
}


/**
 * Counts liberties for the stone at the given position.
 *
 * @private
 * @param {Map} board
 * @param {List} position
 * @returns {number}
 */
export function liberties(board, position) {
    return group(board, position).reduce(
        (acc, pos) => acc.union(matchingAdjacentPositions(board, pos, EMPTY)),
        Set()
    ).size;
}


/**
 * Returns {@link BLACK} if {@link WHITE}, {@link WHITE} if {@link BLACK}.
 *
 * @private
 * @param {string} color
 * @throws {string} when color is neither black nor white
 * @returns {string}
 */
export function oppositeColor(color) {
    if (color !== BLACK && color !== WHITE) {
        throw 'Must pass in a color';
    }
    return color === BLACK ? WHITE : BLACK;
}


/**
 * Checks if given position is a valid play for the given color.
 *
 * @private
 * @param {Map} board
 * @param {List} position
 * @param {List} color
 * @returns {boolean}
 */
export function isLegalMove(board, position, color) {
    const will_have_liberty = liberties(board.set(position, color), position) > 0;
    const will_kill_something = matchingAdjacentPositions(board, position, oppositeColor(color))
        .some(pos => liberties(board, pos) === 1);

    return will_have_liberty || will_kill_something;
}


/**
 * @private
 */
export function prettyString(board) {
    const size = board.get(SIZE_KEY);
    let pretty_string = '';

    for (var i = 0; i < size; i++) {
        for (var j = 0; j < size; j++) {
            let color = board.get(List.of(i, j), EMPTY);
            switch(color) {
                case BLACK:
                    pretty_string += 'O';
                    break;
                case WHITE:
                    pretty_string += 'X';
                    break;
                case EMPTY:
                    pretty_string += '+';
                    break;
            }
        }
        pretty_string += '\n';
    }
    return pretty_string;
}


export default {
    isLegalMove, oppositeColor, liberties, group
};

import {Map, List} from 'immutable';
import {MapSchema, FixedListSchema, OneOf, Exactly} from 'immutable-schema';

import {isPositiveInteger} from './utils';
import {
    SIZE_KEY, allPossibleMoves, group, liberties, isLegalMove,
    BLACK, WHITE, EMPTY, prettyString,
} from './analysis';
import {
    emptyBoard, addBlackMove, addWhiteMove, addMove, removeMoves,
} from './transforms';


/**
 * @private
 */
export const isValidBoardMap = MapSchema(
    FixedListSchema(isNumber, isNumber), OneOf(BLACK, WHITE),
    Exactly(SIZE_KEY), isPositiveInteger
);


/**
 * Represents a board state.
 * @example
 * var Immutable = require('immutable');
 *
 * var board1 = Board(19);
 * var board2_data = Immutable.Map().set('size', 19);
 * var board2 = Board(board2_data);
 *
 * assert(board1.equals(board2));
 */
export class Board {
    /**
     * @param {Map} board_data argument specifying either the backing Map or the size
     * @throws {TypeError} when board_data is neither a proper board Map or a positive integer
     */
    constructor(board_data) {
        if (isValidBoardMap(board_data)) {
            this._positions = board_data;
        } else if (isPositiveInteger(board_data)) {
            this._positions = emptyBoard(board_data);
        } else {
            throw TypeError('Instantiate a Board with a Map or a positive integer');
        }
    }

    /**
     * Immutable data structure holding the positions in a {@link Map}.
     *
     * @returns {Map}
     */
    get positions() {
        return this._positions;
    }

    /**
     * Positive integer representing the size of the board.
     *
     * @returns {number}
     */
    get board_size() {
        return this.positions.get(SIZE_KEY);
    }

    /**
     * Adds a black move at the specified position.  Follows the rules of go
     * which means dead stones will be removed.
     *
     * @param {List} position
     * @throws {string} when the move is not valid
     * @returns {Board}
     * @see {@link addMove}
     */
    addBlackMove(position) {
        return new Board(addBlackMove(this.positions, position));
    }

    /**
     * Adds a white move at the specified position.  Follows the rules of go
     * which means dead stones will be removed.
     *
     * @param {List} position
     * @throws {string} when the move is not valid
     * @returns {Board}
     * @see {@link addMove}
     */
    addWhiteMove(position) {
        return new Board(addWhiteMove(this.positions, position));
    }

    /**
     * Adds a move at the specified position.  Follows the rules of go
     * which means dead stones will be removed.
     *
     * @param {List} position
     * @param {string} color
     * @throws {string} when the move is not valid
     * @returns {Board}
     * @example
     * var board = Board(3);
     * var new_board = board.addBlackMove(position(1, 0));
     *
     * console.log(board.toPrettyString());
     * // +++
     * // +++
     * // +++
     * console.log(new_board.toPrettyString());
     * // +++
     * // O++
     * // +++
     *
     * @example
     * var board = Board(3)
     *     .addBlackMove(position(0, 1))
     *     .addBlackMove(position(2, 1))
     *     .addBlackMove(position(1, 2))
     *     .addWhiteMove(position(1, 1));
     * var new_board.addBlackMove(position(1, 0));
     *
     * console.log(board.toPrettyString());
     * // +O+
     * // +XO
     * // +O+
     * console.log(new_board.toPrettyString());
     * // +O+
     * // O+O
     * // +O+
     */
    addMove(position, color) {
        return new Board(addMove(this.positions, position, color));
    }

    /**
     * Removes positions.  Positions that are not on the board are ignored.
     *
     * @param {Set} positions
     * @returns {Board}
     */
    removeMoves(positions) {
        return new Board(removeMoves(this.positions, positions));
    }

    /**
     * A set of all possible moves on the board, even the occupied ones.
     *
     * @returns {Set} contains Lists (2-tuples)
     */
    allPossibleMoves() {
        return allPossibleMoves(this.board_size);
    }

    /**
     * Gets a set of positions of the logical group associated with the given position.
     *
     * @param {List} position
     * @returns {Set}
     */
    group(position) {
        return group(this.positions, position);
    }

    /**
     * Check if a move is legal for black
     *
     * @param {List} position
     * @returns {boolean}
     */
    isLegalBlackMove(position) {
        return isLegalMove(this.positions, position, BLACK);
    }

    /**
     * Check if a move is legal for white
     *
     * @param {List} position
     * @returns {boolean}
     */
    isLegalWhiteMove(position) {
        return isLegalMove(this.positions, position, WHITE);
    }

    /**
     * Counts liberties for the stone at the given position.
     *
     * @param {List} position
     * @returns {number}
     */
    liberties(position) {
        return liberties(this.positions, position);
    }

    /**
     * Compare with another board.
     *
     * @param {*} other_board Board or Board.positions
     * @returns {boolean}
     */
    equals(other_board) {
        if (!other_board) {
            throw TypeError('Pass in another board to compare');
        }

        return this.positions.equals(other_board.positions || other_board);
    }

    /**
     * @returns {string} ASCII board
     */
    toPrettyString() {
        return prettyString(this.positions);
    }
}

